using LeetCode2023May;
using System.Diagnostics;

Console.WriteLine("LeetCode 2023 May");

bool bres;
int ires;
string sres;
const string WRONG = "Wrong answer!";

sres = Palindrom.LongestPalindrome("babad");
Debug.Assert(sres == "bab" || sres == "aba");

sres = Palindrom.LongestPalindrome("cbbd");
Debug.Assert(sres == "bb");

sres = Palindrom.LongestPalindrome("a");
Debug.Assert(sres == "a");

sres = Palindrom.LongestPalindrome("ac");
Debug.Assert(sres == "a" || sres == "c");


/////////////////////////////////////////////////////////////////
/// 1456. Maximum Number of Vowels in a Substring of Given Length

Stopwatch sw = new Stopwatch();

ires = Vowels.MaxVowels("abciiidef", 3);
Debug.Assert(ires == 3, WRONG);

ires = Vowels.MaxVowels("aeiou", 2);
Debug.Assert(ires == 2, WRONG);

ires = Vowels.MaxVowels("leetcode", 3);
Debug.Assert(ires == 2, WRONG);

ires = Vowels.MaxVowels("weallloveyou", 7);
Debug.Assert(ires == 4, WRONG);

ires = Vowels.MaxVowels("ibpbhixfiouhdljnjfflpapptrxgcomvnb", 33);
Debug.Assert(ires == 7, WRONG);

var str = "";
sw.Start();
ires = Vowels.MaxVowels(str, 50436);
sw.Stop();
Debug.Assert(ires == 9694, WRONG);
Debug.Assert(sw.ElapsedMilliseconds < 10000);


