/// 9. Palindrome Number
bres = Palindrom.IsPalindrome(22);
Debug.Assert(bres);

bres = Palindrom.IsPalindrome(10);
Debug.Assert(!bres);

bres = Palindrom.IsPalindrome(121);
Debug.Assert(bres);

bres = Palindrom.IsPalindrome(-121);
Debug.Assert(!bres);


